import React, { Component } from 'react';
import Prism from "prismjs"
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import '../../ReactJs/styles.css'
import Sidebar from '../sidebar';
import PrismCode from '../../ReactJs/prismCode';

import Stcksval from '../../../assets/stcks.png';

const titles = { backgroundColor: '#F0F8FF', padding: '1px', fontSize: '16px' }

const redesign = {
  height: 200,
  width: 500
}

const styles = theme => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1)
  },
  smMargin: {
    margin: theme.spacing(1)
  },
  actionDiv: {
    textAlign: "center"
  }
})


const rob = `
const rob = (nums = []) => {
  const memo = {}
  const aux = (index = 0) => {
    if (memo[index] !== undefined) {
      return memo[index]
    }
    if (index >= nums.length) {
      return 0
    }
    memo[index] = Math.max(
      aux(index + 2) + nums[index],
      aux(index + 1),
    )
    return memo[index]
  }
  return aux()
}


console.log(rob([2,7,9,3,1]))`.trim();


const maxArea = `
const maxArea = (height = []) => {
  let max = 0
  let left = 0
  let right = height.length - 1
  while (left < right) {
    max = Math.max(max, Math.min(height[left], height[right]) * (right - left))
    if (height[left] <= height[right]) {
      left += 1
    } else {
      right -= 1
    }
  }
  return max
}

console.log(maxArea([1,8,6,2,5,4,8,3,7]))`.trim();

const isValidSudoku = `
const isValidSudoku = (board = []) => {
  const rows = []
  const columns = []
  const boxes = []

  for (let i = 0; i < board.length; i++) {
    for (let j = 0; j < board[i].length; j++) {
      const content = board[i][j]
      if (content !== '.') {
        if (!rows[i]) {
          rows[i] = {}
        }
        if (rows[i][content]) {
          return false
        }
        rows[i][content] = 1

        if (!columns[j]) {
          columns[j] = {}
        }
        if (columns[j][content]) {
          return false
        }
        columns[j][content] = 1
        const boxNum = Math.floor(i / 3) * 3 + Math.floor(j / 3)
        if (!boxes[boxNum]) {
          boxes[boxNum] = {}
        }
        if (boxes[boxNum][content]) {
          return false
        }
        boxes[boxNum][content] = 1
      }
    }
  }
  return true
}

